import React from "react";
import {Card} from 'react-native-shadow-cards';
import {
  StyleSheet,
  Dimensions,
  ScrollView,
  Image,
  ImageBackground,
  Platform,
  AsyncStorage
} from "react-native";
import { Block, Text, theme } from "galio-framework";

import { Button } from "../components";
import { Images, argonTheme } from "../constants";
import { HeaderHeight } from "../constants/utils";

const { width, height } = Dimensions.get("screen");

const thumbMeasure = (width - 48 - 32) / 3;

class Profile extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
     name:'',
      email:'',
      phone_no:'',
      wing:'',
      flat_no:'',
      user_role:'',
      user_role_id:'' ,

    };
    {this.retrieveData("name")}
    {this.retrieveData("email")}
    {this.retrieveData("wing")}
    {this.retrieveData("flat_no")}
    {this.retrieveData("phone_no")}
    {this.retrieveData("user_role")}





  }

  async retrieveData(key) {
    try {
      const value = await AsyncStorage.getItem(key);
      if (value !== null) {
        // We have data!!
        this.setState({
        [key]:value,
        })
      }
    } catch (error) {
      // Error retrieving data
    }
  };
  render() {
    const logoData= '';
    return (
      <Block flex style={styles.profile}>
        <Block flex>
          <ImageBackground
            source={Images.ProfileBackground}
            style={styles.profileContainer}
            imageStyle={styles.profileBackground}
          >
            <ScrollView
              showsVerticalScrollIndicator={false}
              style={{ width, marginTop: '25%' , paddingHorizontal: 8}}
            >
              <Card style={{padding: '2%', margin: 10}}>
              <Block flex style={styles.profileCard}>
                <Block middle style={styles.avatarContainer}>
                  <Image source={{uri: `data:image;base64,${logoData}`}} style={styles.logo}/>
                </Block>
                <Block style={styles.info}>
                  <Block
                    middle
                    row
                    space="evenly"
                    style={{ marginTop: 20, paddingBottom: 24 }}
                  >
                    <Button
                      small
                      style={{ backgroundColor: argonTheme.COLORS.WARNING, height:50, width:150 }}
                    >
                      <Text style={{color:'white'}}> {this.state.user_role}</Text>
                    </Button>

                  </Block>
                </Block>
                <Block flex  style={{width:'auto'}}>
                  <Block middle style={styles.nameInfo}>
                    <Text bold size={24} color="#32325D" style={{width:'auto'}}>
                      {this.state.name} , 27
                    </Text>
                    <Text bold size={18} color="#32325D" style={{width:'auto'}}>
                      {this.state.email} , {this.state.phone_no}
                    </Text>
                    <Text size={16} color="#32325D" style={{ marginTop: 10 }}>
                      Wing: {this.state.wing}, {this.state.flat_no}
                    </Text>
                  </Block>
                  <Block middle style={{ marginTop: 30, marginBottom: 16 }}>
                    <Block style={styles.divider} />
                  </Block>
                  <Block middle>
                    <Text
                      size={16}
                      color="#525F7F"
                      style={{ textAlign: "center" }}
                    >
                      An artist of considerable range, Jessica name taken by
                      Melbourne 
                    </Text>
                  </Block>

                </Block>
              </Block>
              </Card>
            </ScrollView>
          </ImageBackground>
        </Block>
      </Block>
    );
  }
}

